na (Taiwan)'),(140,'Tansania','Tanzanie','',''),(141,'Ukraine','Ukraine','',''),(142,'Uganda','Ouganda','',''),(143,'Vereinigte Staaten von Amerika','États-Unis d\'Amérique','',''),(144,'Uruguay','Uruguay','',''),(145,'Usbekistan','Ouzbékistan','',''),(146,'Staat Vatikanstadt','État de la Cité du Vatican','Stato della Città del Vaticano','Vatican City State'),(147,'Venezuela','Venezuela','',''),(148,'Vietnam','Vietnam','',''),(149,'Kosovo','Kosovo','',''),(150,'Jemen','Yémen','',''),(151,'Südafrika','Afrique du Sud','',''),(152,'Sambia','Zambie','',''),(153,'Erteilte Ausfuhrbewilligungen für besondere militärische Güter 2018','','',''),(154,'Ausfuhren 2017 von Kriegsmaterial nach Kategorie pro Endempfängerstaat','','',''),(155,'Ausfuhren 2018 von Kriegsmaterial nach Kategorie pro Endempfängerstaat','','',''),(156,'4. Quartal 2018 Erteilte Ausfuhrbewilligungen für andere Güter','','',''),(157,'Ausfuhr','','',''),(158,'Einzelbewilligung','','',''),(159,'Kriegsmaterial','','',''),(160,'Besondere militärische Güter','','',''),(161,'Dual Use Güter','','',''),(162,'514.511 Anhang 1','','',''),(163,'Hand- und Faustfeuerwaffen jeglichen Kalibers und Zubehör sowie besonders konstruierte Bestandteile hierfür, jedoch ohne:\r\n\r\na.\r\neindeutig erkennbare Jagd- und Sportwaffen (z. B. nach ISSF-Norm), die in derselben Ausführung nicht auch Kampfwaffen sind;\r\nb.\r\nEinzellader und Vorderlader;\r\nc.\r\nFaustfeuerwaffen und Repetiergewehre für Randfeuermunition;\r\nd.\r\nalte Waffen, für die keine verwendbare Munition mehr hergestellt wird oder im öffentlichen Handel erhältlich ist.\r\nAnmerkung: KM 1.d. erfasst auch folgende Waffen:\r\n\r\n1.\r\nMusketen, Gewehre und Karabiner, die vor 1890 hergestellt wurden, und ihre Nachbildungen;\r\n2.\r\nRevolver, Pistolen und Maschinenwaffen, die vor 1890 hergestellt wurden, und ihre Nachbildungen.\r\nKM 1.a. bis KM 1.d. erfassen auch für Exerziermunition besonders konstruierte Waffen, die keine von Nummer KM 3 erfasste Munition verschiessen können.','Armes individuelles à épauler et armes de poing de tout calibre, leurs accessoires et leurs composants spécialement conçus, à l\'exception des armes suivantes:\r\n\r\na.\r\narmes de chasse et armes de sport incontestablement reconnaissables (p. ex. selon les normes ISSF) qui, dans la même exécution, ne sont pas également des armes de combat;\r\nb.\r\narmes à un coup et armes se chargeant par la bouche;\r\nc.\r\narmes de poing et fusils à répétition tirant des cartouches à percussion annulaire;\r\nd.\r\narmes anciennes, pour lesquelles des munitions utilisables ne sont plus fabriquées ou ne se trouvent plus dans le commerce.\r\nNotes:\r\n\r\nLa rubrique KM 1d vise également les armes suivantes:\r\n\r\n1.\r\nmousquets, fusils et carabines fabriqués avant 1890, ainsi que leurs reproductions;\r\n2.\r\nrevolvers, pistolets et mitrailleuses fabriqués avant 1890, ainsi que leurs reproductions.\r\nNote:\r\n\r\nLes rubriques KM 1a à KM 1d visent également les armes spécialement conçues pour des munitions inertes d\'instruction, qui ne peuvent tirer aucune des munitions visées à la rubrique KM 3.','Armi da fuoco portatili di ogni calibro e loro accessori nonché loro componenti appositamente progettati, ad eccezione tuttavia:\r\n\r\na.\r\ndelle armi da caccia e delle armi da sport, indubbiamente riconoscibili come tali (p. es. secondo le norme ISSF), che nella stessa esecuzione non possono essere usate come armi da combattimento;\r\nb.\r\ndelle armi a colpo singolo e delle armi ad avancarica;\r\nc.\r\ndelle armi da fuoco portatili e di fucili a ripetizione a munizione a percussione periferica;\r\nd.\r\ndelle vecchie armi, per le quali non sono più fabbricate o non sono più in commercio munizioni utilizzabili.\r\nNota: Il punto KM 1.d. sottopone a autorizzazione anche le armi seguenti:\r\n\r\n1.\r\nmoschetti, fucili e carabine anteriori al 1890 e loro riproduzioni;\r\n2.\r\nrivoltelle, pistole e mitragliatrici anteriori al 1890 e loro riproduzioni.\r\nNota: I punti KM 1.a. - KM 1.d. sottopongono a autorizzazione anche armi appositamente progettate per munizioni a salve, non in grado di sparare alcuna munizione di cui al punto KM 3.','Hand guns and small arms of any calibre and accessories and specially designed components therefor, but not including:\r\n\r\na.\r\nClearly recognisable hunting and sports weapons (e.g. as per ISSF standard) that cannot also be used as military weapons in the same form;\r\nb.\r\nSingle-shot firearms and muzzle-loading firearms;\r\nc.\r\nSmall arms and repeating rifles for rimfire ammunition;\r\nd.\r\nAntique weapons for which usable ammunition is no longer produced or which are no longer available on the public market.\r\nNote: ML 1.d. also controls the following weapons:\r\n\r\n1.\r\nMuskets, rifles and carbines manufactured before 1890 , and their reproductions;\r\n2.\r\nRevolvers, pistols and machine guns manufactured before 1890 , and their reproductions.\r\nML 1.a. to ML 1.d. also control weapons specially designed to fire dummy ammunition, which cannot fire ammunition controlled by ML 3.'),(164,'946.202.1 Anhang 3','','',''),(165,'Europäische Union','Union européenne','Unione europea','European Union'),(166,'Afrika','Afrique','','Africa'),(167,'Nord Amerika','Amerique du Nord','America del Nord','North America'),(168,'Ozeanien','Océanie','','Oceania'),(170,'Asien','','','Asia'),(171,'Europa','Europe','Europa','Europe'),(172,'Südamerika','','','South America'),(173,'946.202.1 Anhang 5','','',''),(174,'946.202.1 Anhang 1','','',''),(175,'946.202.1 Anhang 2','','',''),(176,'946.202.21','','',''),(177,'Waffen, wesentliche Waffenbestandteile, Waffenzubehör, Munition und Munitionsbestandteile nach dem WG, die nicht der Kriegsmaterialgesetzgebung unterliegen und von Anhang 3 nicht erfasst werden. Ausgenommen sind im nichtgewerbsmässigen Verkehr Messer und Dolche nach Artikel 7 der Waffenverordnung vom 2. Juli 2008.','Les armes, les éléments essentiels d\'armes, les accessoires d\'armes, les munitions et les éléments de munitions au sens de la LArm qui ne sont pas soumis à la législation sur le matériel de guerre ni visés à l\'annexe 3. Sont exemptés du trafic à titre non professionnel les couteaux et les poignards selon l\'art. 7 de l\'ordonnance du 2 juillet 2008 sur les armes.','Armi, parti essenziali di armi, accessori di armi, munizioni ed elementi di munizioni conformemente alla LArm che non sono soggetti alla legislazione sul materiale bellico e neppure all\'allegato 3 della presente ordinanza. Fanno eccezione, nel commercio non professionale, coltelli e pugnali conformemente all\'articolo 7 dell\'ordinanza del 2 luglio 2008 sulle armi.','Weapons, essential weapons parts and components, weapons accessories, ammunition or ammunition parts and components in terms of the WA that are not subject to the legislation on war material and are not included in Annex 3. Exempted from the foregoing are knives and daggers in terms of Article 7 of the Weapons Ordinance of 2 July 2008 that are in non-commercial circulation.'),(178,'Sprengmittel und Schiesspulver nach dem Sprengstoffgesetz vom 25. März 1977, die nicht der Kriegsmaterialgesetzgebung unterliegen und nicht von den Anhängen 2 und 3 erfasst werden.','Les matières explosives et la poudre de guerre au sens de la loi du 25 mars 1977 sur les explosifs qui ne sont pas soumises à la législation sur le matériel de guerre ni visées aux annexes 2 et 3.','Esplosivi e polvere esplosiva conformemente alla legge federale del 25 marzo 1977 sugli esplosivi che non sono soggetti alla legislazione sul materiale bellico e agli allegati 2 e 3 della presente ordinanza.','Explosives and propellant powder under the Explosives Act of 25 March 1977 that are not subject to the legislation on war material and are not included in Annexes 2 and 3.'),(179,'Republik Ruanda','République du Rwanda','Repubblica del Ruanda','Republic of Rwanda'),(180,'Republik Côte d’Ivoire','République de Côte d’Ivoire','République de Côte d\'Ivoire','Republic of Côte d\'Ivoire'),(181,'Republik Fidschi','République des Fidji','Repubblica di Figi','Republic of Fiji'),(182,'Republik Albanien','République d’Albanie','Repubblica d\'Albania','Republic of Albania'),(183,'Republik Kongo','République Démocratique du Congo','Repubblica Democratica del Congo','Democratic Republic of the Congo'),(184,'Bundesrepublik Somalia','République fédérale de Somalie','Repubblica Federale di Somalia','Federal Republic of Somalia'),(185,'Republik Dschibuti','République de Djibouti','Repubblica di Gibuti','Republic of Djibouti'),(186,'Aruba','Aruba','Aruba','Aruba');
